import React from 'react';
import style from './Dialogs.module.css';
import { NavLink } from 'react-router-dom';

const DialogItem = (props) => {
  let path = "/Dialogs" + props.id;
  return (
    <div className={style.dialog}>
    <NavLink to={path}>{props.name}</NavLink>
    </div>
  )
}

const MessageItem = (props) => {
  return (
    <div className={style.messages}>{props.message}</div>
  )
}


const Dialogs = (props) => {

  let DialogsData = [
    {  id: 1, name: 'Andzrej'},
    { id: 2, name: 'Grzegorz'},
    { id: 3, name: 'Swetlana'},
    { id: 4, name: 'Dmitrij'},
    { id: 5, name: 'Konstantin'}
  ]

  return (
    <div className={style.content}>
    <div className={style.dialog} >
    <DialogItem name={DialogsData[0].name} id="1"/>
    <DialogItem name={DialogsData[1].name} id="2"/>
    <DialogItem name={DialogsData[2].name} id="3"/>
    <DialogItem name={DialogsData[3].name} id="4"/>
    <DialogItem name={DialogsData[4].name} id="5"/>
    </div>
    <div className={style.messages}>
    <MessageItem message="Hi" />
    <MessageItem message="Hello. How are you?" />
    <MessageItem message="Siemasz co tam?" />
    <MessageItem message="Wiez nie pierdol" />
    <MessageItem message="GTFO! man! GTFO!!!" />

    </div>
    </div>
  );
}

export default Dialogs;
